package WrapperClass;

public class programClass_1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
        // wrapper class is used to convert primitive data into objective data or objective data into primitive data
		
		
		int i = 100;
		
		Integer x = Integer.valueOf(i);
		System.out.println("Wrapper Class Converted Value Is - "+ x);
		
		int a = 100;
		Integer z = a;
		System.out.println(z);
		
		

	}

}
